2803887722080936828=<ph name="BEGIN_H3">Funciones de depuración<ph name="END_H3"><br>    <ph name="BR"><br>    Puedes habilitar las funciones de depuración en tu dispositivo Chrome OS para instalar y probar código personalizado en el dispositivo. Esto te permitirá:<ph name="BR"><br>    <ph name="BEGIN_LIST"><br>      <ph name="LIST_ITEM">Eliminar la verificación de rootfs para poder modificar archivos del<br>sistema operativo<br>      <ph name="LIST_ITEM">Habilitar el acceso SSH al dispositivo mediante las claves de prueba de tipo estándar para poder utilizar herramientas como <ph name="BEGIN_CODE">cros flash<ph name="END_CODE"> para acceder al dispositivo<br>      <ph name="LIST_ITEM">Habilitar el arranque desde USB para poder instalar una imagen del<br>sistema operativo desde una unidad USB<br>      <ph name="LIST_ITEM">Establecer un valor personalizado para las contraseñas de inicio de sesión de raíz del sistema y dev para poder acceder al dispositivo manualmente mediante SSH<br>    <ph name="END_LIST"><br>    <ph name="BR"><br>    Una vez habilitadas, la mayoría de las funciones de depuración seguirán estando activadas incluso después de realizar un Powerwash o borrar los datos en dispositivos administrados por la empresa. Para inhabilitar por completo todas las funciones de depuración, debes realizar el proceso de recuperación de Chrome OS (https://support.google.com/chromebook/answer/1080595).<br>    <ph name="BR"><br>    <ph name="BR"><br>    Para obtener más información sobre las funciones de depuración, consulta la siguiente página:<ph name="BR"><br>    http://www.chromium.org/chromium-os/how-tos-and-troubleshooting/debugging-features<br>    <ph name="BR"><br>    <ph name="BR"><br>    <ph name="BEGIN_BOLD">Nota:<ph name="END_BOLD"> El sistema se reiniciará durante el proceso.</ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph>
